import React from "react";
import VIT from "../components/pages/image/VIT.svg";

function Footer() {
  return (
    <div className="Foot">
      <h1 className="retroshadow foot-h1">I Study At</h1>
      <br />
      <img src={VIT} className="foot-img" />
      <div>
      <button className="fbtn">
        <p className="words">Vishwakarma Institute of Technology</p>
      </button>
      </div>
      <br/>
    </div>
  );
}

export default Footer;
